import { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom'
import { Title } from './helper/DocumentTitle'
import Loading from './components/LoadingSpinner'
import { CheckIcon, ChromeIcon, BraveIcon } from './components/icons'
import toast, { Toaster } from 'react-hot-toast'
import styles from './Home.module.scss'
import Logo from '../../public/upnote.svg'
import { useAuth } from './../contexts/AuthContext'
const client = new xrpl.Client('wss://s.devnet.rippletest.net:51233/')

function Home({ title }) {
  Title(title)
  const [isLoading, setIsLoading] = useState(false)
  const [wallet, setWallet] = useState()
  const [balance, setBalance] = useState()
    const [nftHash, setNftHash] = useState()
  const auth = useAuth()
  const navigate = useNavigate()
  const [QRcode, setQRcode] = useState()

  const awesomeQRcode = (data, bg) => {
    toDataURL(bg, function (dataURL) {
      //  console.log(dataURL);
      return new AwesomeQR.AwesomeQR({
        text: data,
        size: 500,
        backgroundImage: dataURL, //'./logo11w.png'
        dotScale: 0.6,
        correctLevel: 2,
        colorDark: '#000',
        colorLight: '#fff',
        autoColor: false,
      })
        .draw()
        .then((dataURL) => {
          // console.log(dataURL)
          setQRcode(dataURL)
        })
    })
  }

  function toDataURL(src, callback) {
    let image = new Image()
    image.crossOrigin = 'Anonymous'
    image.onload = function () {
      let canvas = document.createElement('canvas')
      let context = canvas.getContext('2d')
      canvas.height = this.naturalHeight
      canvas.width = this.naturalWidth
      context.drawImage(this, 0, 0)
      let dataURL = canvas.toDataURL('image/jpeg')
      callback(dataURL)
    }
    image.src = src

    setIsLoading(false)
  }

  const createWallet = async () => {
    let t = toast.loading(`Creating a dev wallet account & fund it...`)
    await client.connect()
    // Create a wallet and fund it with the Testnet faucet:
    const fund_result = await client.fundWallet()
    console.log(fund_result)
    setWallet(fund_result.wallet)
    awesomeQRcode(
      'XRPL: ' + fund_result.wallet.classicAddress,
      'data:image/png;base64,'
    )
    setBalance(fund_result.balance)
    toast.success(`Wallet is created`, { icon: '🎉' })
    console.log(fund_result)
    toast.dismiss()
    await client.disconnect()
  }

  const mintNFT = async () => {
    let t = toast.loading(`Minting NFT...`)
    await client.connect()

    // Create a wallet and fund it with the Testnet faucet:

    // Mint NFT
    const transactionJson = {
      TransactionType: 'NFTokenMint',
      Account: wallet.address,
      URI: xrpl.convertStringToHex('https://example.com'),
      Flags: parseInt(8),
      TransferFee: parseInt(2000), // As fee, monitization
      NFTokenTaxon: 0, //Required, but if you have no use for it, set to zero.
    }
    const tx = await client.submitAndWait(transactionJson, {wallet: wallet})
    console.log(tx)
 if (tx.result.meta.TransactionResult === 'tesSUCCESS') toast.success(`Your NFT minted successfuly!`, {icon:'🚀'})
setNftHash(`https://devnet.xrpl.org/transactions/${tx.result.hash}`)
    toast.dismiss()
    await client.disconnect()
  }

  useEffect(() => {}, [])

  return (
    <>
      {isLoading && <Loading />}

      <section className={styles.section}>
        <div className={`__container text-center`} data-width="medium">
          <h6 className="mb-40">
            <p>
              <b>Convert your XRPL wallet address to an NFT</b>
            </p>
            <small>Drop your new NFT!</small>
          </h6>

          {wallet && (
            <div className="card">
              <div className="card__body">
                <p>Your XRPL wallet is created and funded. It's ready to mint your NFT</p>
                <ul className="d-flex flex-column align-items-start">
                  <li>
                    Wallet address: <b>{wallet.classicAddress}</b>
                  </li>
                  <li>
                    Wallet balance: <b>{balance}</b>
                  </li>
                  <li>
                    Your address-based NFT:
                    <div className={`d-flex flex-column`}>{QRcode && <img alt="QRCode" src={QRcode} style={{ width: '210px' }} />}</div>
                  </li>
                  <li>
                    {
                      nftHash && <>
                      Minted: 
                      <a target='_blank' href={nftHash} style={{color: 'var(--color-primary)'}} className='mt-40'>Transaction Hash</a>
                      </>
                    }
                  </li>
                </ul>
              </div>
            </div>
          )}

          {wallet ? (
            <>
              <button className="button" style={{ padding: '1rem', marginTop: '1rem', borderRadius: '999px', background: 'var(--area3)' }} onClick={() => mintNFT()}>
                <span className="animate__animated animate__heartBeat animate__infinite" style={{ display: 'inline-block' }}>
                  💥
                </span>
                Mint your NFT
              </button>
            </>
          ) : (
            <>
              <button className="btn" onClick={() => createWallet()}>
                <span className="animate__animated animate__fadeIn animate__infinite" style={{ display: 'inline-block' }}>
                  ⚡
                </span>
                Create XRPL Wallet
              </button>
            </>
          )}
        </div>
      </section>
    </>
  )
}

export default Home
